import skills from "../../Data/skills.json"

const Experience =() =>(
    <section>
        <h2>Experience</h2>
        <div>
            <div>
                {
                    skills.map((skill,id)=>(
                        <img src=""  alt=""/>
                    ))
                }
            </div>
        </div>
    </section>
)

export default Experience
